listRule:
owner = null ||
( owner != null && (
    owner.id = @request.auth.id ||
    ( @collection.authorizations.record_id = id &&
      @collection.authorizations.users.id ?= @request.auth.id &&
      @collection.authorizations.owner.id ?= owner.id )
  )
)

